import React from "react";
import Navbar from "../navmenu/Navbar";
import Contact from "../Contact";
import { withStyles } from "@material-ui/core/styles";
import BlogPostTemplate from "./BlogPostTemplate";
import backgroundImg from "../../img/angrycat.jpg";
import { Typography, Box, Link } from "@material-ui/core";

const styles = (theme) => ({
  contentArea: {
    width: "70%",
    margin: "0 auto 5rem auto",
  },
  paragraphTitle: {
    lineHeight: "3rem",
    margin: "0 0 1rem 0",
  },
  paragraphContent: {
    lineHeight: "2rem",
    margin: "0 1rem 1rem 1rem",
    textAlign: "justify",
  },
  signature: {
    // textAlign: "right",
    margin: "0 5rem 0 0",
  },
});

const BlogPost2 = (props) => {
  const { classes } = props;

  return (
    <>
      <Navbar />
      <Box className={classes.contentArea}>
        <BlogPostTemplate
          title="fan of cats"
          subtitle="the story of me and cats"
          date="August 15, 2020"
          image={backgroundImg}
        />
        <Typography variant="h5" className={classes.paragraphTitle}>
          When I Started Liking Cats
        </Typography>
        <Typography variant="body1" className={classes.paragraphContent}>
          4/1/20. I've never really been a huge animal person. Don't get me
          wrong, I think animals are precious and awesome, but I think it's
          because I never really had pets and so I just never had the experience
          being so close to animals. Around that time though, I just started
          really liking cats all of a sudden. I really don't know why. It'd
          probably been building up for a few months prior, and then when we got
          kicked off campus and had to quarantine for 5 months, and so I guess
          I'm a cat lady without any pet cats now.
        </Typography>

        <Typography variant="h5" className={classes.paragraphTitle}>
          Recommendations
        </Typography>
        <Typography variant="body1" className={classes.paragraphContent}>
          These are some thoughts about cat social media accounts:
          <li>
            <Link href={props.bloglink} variant="body1">
              {props.title}
            </Link>{" "}
            - Even though this is "A subreddit for cute and cuddly pictures",
            implying that it's a space for all cute and cuddly animals, you will
            find an overwhelming number if cat pictures because they're the
            best.
          </li>
          <li>
            <a href="https://www.instagram.com/pleasantcats/">
              @pleasantcats on instagram
            </a>{" "}
            - This one just showed up on my feed one day and it has some pretty
            quality content, emphasis on the some. The content is super varied,
            which is good, but that means some videos are bad and some are good.
            What exactly defines a good cat video vs. a bad vat video? Well
            that's a topic for another blog post.
          </li>
          <li>
            <a href="https://www.instagram.com/cats_of_instagram">
              @cats_of_instagram on instagram
            </a>{" "}
            - I just looked up "cats" on instagram and this showed up. It has
            11.6 million followers at this point, so I'm at least someone would
            recommend them. After scanning their page pretty quickly, I think
            their videos are more on the cute side rather than derpy or funny
            cat side. I personally like the derp, but I definitely see the
            appeal of the cute.
          </li>
          <li>
            <a href="https://www.instagram.com/catsdoingthings">
              @catsdoingthings on instagram
            </a>{" "}
            - So this one also came up when I searched "cats" on instagram, but
            it seems to have more of the derp vibe that I talked about in the
            last point. It has 1.1 million followers which is nothing to scoff
            at, but significantly less than @cats_of_instagram! After looking at
            their page for a bit, they're definitely catering towards those who
            like cat memes other funny cat media. Definitely up my alley.
          </li>
        </Typography>

        <Typography variant="h6" className={classes.signature}>
          Cheerio, <br />
          Kelly
        </Typography>
      </Box>
      <Contact />
    </>
  );
};

export default withStyles(styles)(BlogPost2);
